            <img  src={css13} alt="discord"/>
            <img  src={css14} alt="discord"/>
            <img  src={css15} alt="discord"/>
            </div> */}
            {/* <h2 className="font-high text-purple-400 px-5 py-10">Cool Things coming Soon</h2> */}
            </div>
        </div> 
    ); 
}
